import React from 'react'
import styled from 'styled-components'

const WebsiteTitle = () => {
  return(
    <Title>Clubs@CU</Title>
  );
}

const Title = styled.h2`
  font-size: 1.5rem;
  font-family: 'Manrope', 'Arial', 'Helvetica';
  font-weight: 700;
`;
export default WebsiteTitle;
